# Now run tests

def brute_count_9(N):
    div = [0] * (N+1)
    for i in range(1, N+1):
        for j in range(i, N+1, i):
            div[j] += 1
    cnt = 0
    for i in range(1, N+1):
        if div[i] == 9:
            cnt += 1
    return cnt

# Test small N
for N in [1,2,3,4,5,10,36,100,200,500,1000]:
    expected = brute_count_9(N)
    actual = solution.count_divisors_9(N)
    print(N, expected, actual, 'OK' if expected==actual else 'FAIL')

# Test some random Ns up to 2000
import random
for N in [random.randint(1,2000) for _ in range(20)]:
    expected = brute_count_9(N)
    actual = solution.count_divisors_9(N)
    if expected != actual:
        print('Mismatch for', N, expected, actual)
        break
else:
    print('All random tests up to 2000 passed')

